window.bookSummaryJSON = "<p><b>All is fair in war and magic.</b></p> <p>I have power no other witch has had in thousands of years.</p> <p>My whole Coven is looking to me for guidance.</p> <p>I thought I had a flawless plan, but now nothing is playing out the way I expected. To close the Gap in Salem before Samhain we must collect all five Elemental Stones. The quest to find them sends us deep into the treacherous lands of other supernatural species - where The Coven is far from welcome and heavily outnumbered.</p> <p>We’ve rolled the dice in a game without rules. To succeed we’ll have to use tricks we’ve never played and pray we all make it out alive.</p> <p><b>The magic continues in </b><b><i>The Eternal Witch</i></b><b>, the fifth book in the adventure-filled Elemental Magic series that’s leaving listeners begging for more!</b></p>"; 
